VALUES ('3450350032065', 'Le Sapin Apéritif', 'Duo de saumon et truite fumée aux zestes de citrons semi-confits sur pain de mie aux épinards 42,1 % : pain de mie aux épinards 11,5 % (farine de _blé_, épinard 3,5 %, sirop de sucre inverti, eau, _beurre_, _œuf_ entier en poudre, levure de boulangerie, sel, gluten de _blé_), _fromage_ frais, _fromage_ blanc, _saumon_ cuit 4,4 % (_saumon_, sel), _truite_ fumée 4,4 % (_truite_ fumée Oncochynchus mykiss 4,2 %, sel), épices (poivron, poivre, coriandre, graines de _moutarde_, carvi, oignon, huile de colza), eau, amidon transformé de pomme de terre, huile de tournesol, ciboulette, purée de tomate, zeste de citron semi confit 0,4 % (sirop de glucose-fructose, zestes de citron jaune 0,1 %, eau, sucre, correcteur d\'acidité : acide citrique, antioxydant : acide ascorbique), jus de citron, basilic, échalote, sel. Fromage de brie et noisettes sur pain de mie complet 28,9 % : _crème_ de brie fondu 13,3 % (brie 7,6 %, eau, _beurre_, poudre de _lait_, fécule de manioc, sel), pain de mie complet 11,4 % (préparation à base de farine (farine complète de _blé_, _gluten_ de _blé_, sel, agent de traitement de la farine : acide ascorbique), eau, farine de _blé_, améliorant de panification (farine de _blé_ malté toasté, sucre caramélisé en poudre (sirop de glucose et sucre caramélisé), poudre de cacao dégraissé, _gluten de blé_), _beurre_, levure de boulangerie, _œuf_ entier en poudre, sel, farine de _blé_), _crème_ stérilisée (_crème_ de _lait_, stabilisant : carraghénanes), _noisette_ 1,3 %, amidon transformé de pomme de terre. Mousse de canard figues et chutney d\'oignons sur pain de mie rose 28,9 % : pain de mie rose 11,4 % (farine de _blé_, eau, colorant : rouge de betterave, sirop de sucre inverti, levure de boulangerie, _beurre_, _lait_ écrémé en poudre, sel, sucre, _gluten_ de _blé_), mousse de canard au porto 10,5 % (graisse de canard 3,1 %, foie maigre de canard 3,1 %, eau, foie gras de canard 1 %, _œufs_, porto 0,3 %, _lait_ écrémé en poudre, sel, amidon de maïs, protéines de _lait_, épices (muscade, cannelle, poivre, coriandre, carvi, girofle, piment), dextrose de _blé_, antioxydant : ascorbate de sodium, conservateur : nitrite de sodium), figue 3 % (figues, farine de riz), eau, chutney d\'oignon (oignon blanc, sucre roux, raisins secs noir, vinaigre de xérès, vin rouge, jus de citron, gélifiant : carraghénanes, ail, cannelle, gingembre), amidon transformé de pomme de terre.', 'https://static.openfoodfacts.org/images/products/345/035/003/2065/front.12.400.jpg', '13.1', '6.6', '24.2', '2.7', '', '7.7', '1', '0.393700787401575', '', '1');

