porabiti do datuma, oznaëenega na foliji na zgornji strani. Hranite na temperaturi od OOC do +40C. Po odprtju porabite v 24 urah. Pridelano v Franciji. Pakirano v kontrolirani atmosferi.', '', '14.5', '7.3', '26.9', '3.2', '2.2', '4.9', '1.06', '0.417322834645669', '', '0');

